import './DoctorAccount.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function DoctorAccount() {
    const[signUp, setSignUp] = useState(false);
    const[signIn, setSignIn] = useState(false);
    const navigate = useNavigate();

    const handleClick = (input) => {
        if (input === "sign up") {
            setSignUp(true);
        } else if (input === "sign in") {
            setSignIn(true);
        }
    }
    return (
        <div>
            <h1>Doctor</h1>
            {!signIn && !signUp ? (
                <div className='account-container'>
                    <button className="account-button" onClick={() => handleClick("sign in")}>Sign In</button>
                    <button className="account-button" onClick={() => handleClick("sign up")}>Create An Account</button>
                </div>
            ): null}
            {signIn ? (
                <div className='sign-in-container'>
                    <h2>Sign In</h2>
                    <form>
                        <label>Email:</label>
                            <input type="email"/>
                        <label>Password:</label>
                            <input type="password"/>
                        <button type="submit">Submit</button>
                    </form>
                    <button className='back-button' onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}

        </div>
    )
}
